remove_dollars([$$|Chars]) ->
    list_to_atom(Chars).

replace_regexp_slash([$/|Chars]) ->
    replace_regexp_slash(lists:reverse(Chars), return_when_done).
replace_regexp_slash([$/|Chars], return_when_done) ->
    "\"" ++ lists:reverse(Chars) ++ "\"".


