    {Action,Alen,Tlen,Ics,Line,Col,459};
yystate(458, Ics, Line, Col, Tlen, _, _) ->
    {127,Tlen,Ics,Line,Col};
yystate(457, [115|Ics], Line, Col, Tlen, Action, Alen) ->
    yystate(453, Ics, Line, Col, Tlen+1, Action, Alen);
